import React, { useEffect, useRef } from "react";
import mapboxgl from "mapbox-gl";
import "mapbox-gl/dist/mapbox-gl.css";

// Directly use your Mapbox token
mapboxgl.accessToken =
  "pk.eyJ1IjoibWFwZmVhbiIsImEiOiJjbTNuOGVvN3cxMGxsMmpzNThzc2s3cTJzIn0.1uhX17BCYd65SeQsW1yibA";

// Frost API credentials (hardcoded)
const FROST_CLIENT_ID = "12f68031-8ce7-48c7-bc7a-38b843f53711";
const FROST_CLIENT_SECRET = "08a75b8d-ca70-44a9-807d-d79421c082bf";

const WeatherStationsMap = () => {
  const mapContainer = useRef(null);
  const mapRef = useRef(null);

  // Convert Frost API response into GeoJSON
  const frostToGeoJSON = (stations) => {
    const features = stations
      .filter((station) => station.geometry && station.geometry.coordinates)
      .map((station) => {
        // Frost already returns [lon, lat] ‚Üí no swapping needed
        return {
          type: "Feature",
          geometry: {
            type: "Point",
            coordinates: station.geometry.coordinates,
          },
          properties: {
            id: station.id,
            name: station.name,
            shortName: station.shortName || "Unknown",
            country: station.country || "Norway",
          },
        };
      });

    console.log(`‚úÖ Converted ${features.length} stations into GeoJSON features`);
    console.log("üîç First station:", features[0]);
    return {
      type: "FeatureCollection",
      features,
    };
  };

  // Fetch stations from Frost API via local proxy
  const fetchStations = async () => {
    try {
      const frostAuth = btoa(`${FROST_CLIENT_ID}:${FROST_CLIENT_SECRET}`);
      console.log("üåç Fetching stations from Frost API...");

      const response = await fetch(
        "/frost/sources/v0.jsonld?types=SensorSystem",
        {
          headers: {
            Authorization: `Basic ${frostAuth}`,
            Accept: "application/json",
          },
        }
      );

      console.log("üîÑ Response status:", response.status);

      if (!response.ok) {
        throw new Error(`‚ùå Frost API error: ${response.status}`);
      }

      const data = await response.json();
      console.log("üì¶ Frost API raw data:", data);

      return data.data || [];
    } catch (error) {
      console.error("üö® Error fetching Frost data:", error);
      return [];
    }
  };

  // Initialize Mapbox and add stations
  useEffect(() => {
    const initMap = async () => {
      if (mapRef.current) return;

      console.log("üó∫Ô∏è Initializing Mapbox map...");

      // Initialize Mapbox map
      mapRef.current = new mapboxgl.Map({
        container: mapContainer.current,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [10.75, 59.91], // Oslo center
        zoom: 5,
      });

      // Add a test marker in Oslo to confirm the map works
      new mapboxgl.Marker()
        .setLngLat([10.75, 59.91])
        .setPopup(new mapboxgl.Popup().setText("Test Marker"))
        .addTo(mapRef.current);

      // Fetch stations
      const stations = await fetchStations();
      console.log(`üìä Total stations fetched: ${stations.length}`);

      if (stations.length === 0) {
        console.warn("‚ö†Ô∏è No stations returned from Frost API");
        return;
      }

      const geojson = frostToGeoJSON(stations);
      console.log("üåê GeoJSON:", geojson);
      console.log("üîç First station coords:", geojson.features[0]?.geometry.coordinates);

      // Add station markers to map
      mapRef.current.on("load", () => {
        console.log("üõ∞Ô∏è Mapbox loaded, adding station data...");

        // Add the stations GeoJSON source
        mapRef.current.addSource("stations", {
          type: "geojson",
          data: geojson,
        });

        // Force the map to fit all Norway stations
        mapRef.current.fitBounds(
          [
            [4, 57],  // Southwest corner of Norway
            [31, 72], // Northeast corner of Norway
          ],
          { padding: 20 }
        );

        // Get the top-most existing layer ID
        const topLayerId =
          mapRef.current.getStyle().layers.slice(-1)[0].id;

        // Add the stations layer **on top** of everything else
        mapRef.current.addLayer(
          {
            id: "stations-layer",
            type: "circle",
            source: "stations",
            paint: {
              // Larger, more visible markers
              "circle-radius": [
                "interpolate",
                ["linear"],
                ["zoom"],
                0, 4,
                5, 6,
                10, 10,
                15, 16,
              ],
              "circle-color": "#ff6600", // Bright orange for visibility
              "circle-stroke-width": 1,
              "circle-stroke-color": "#fff",
              "circle-opacity": 0.9,
            },
          },
          topLayerId // Ensures it's above other labels
        );

        console.log("‚úÖ Station layer added to map");

        // Debug: list all layers to confirm our layer exists
        console.log(
          "üß© Map layers:",
          mapRef.current.getStyle().layers.map((l) => l.id)
        );

        // Add popups on click
        mapRef.current.on("click", "stations-layer", (e) => {
          const props = e.features[0].properties;
          const coords = e.features[0].geometry.coordinates;

          new mapboxgl.Popup()
            .setLngLat(coords)
            .setHTML(`
              <strong>${props.name}</strong><br/>
              ID: ${props.id}<br/>
              Country: ${props.country}
            `)
            .addTo(mapRef.current);
        });

        // Change cursor when hovering over stations
        mapRef.current.on("mouseenter", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "pointer";
        });

        mapRef.current.on("mouseleave", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "";
        });
      });
    };

    initMap();
  }, []);

  return (
    <div
      ref={mapContainer}
      style={{ width: "100%", height: "100vh", borderRadius: "10px" }}
    />
  );
};

export default WeatherStationsMap;
